import React from "react";
import books from "../../card/dump"
import Card from "../../card/card";

function createCard(books) {
    return (
      <Card
        key={books.id}
        title={book.title}
        author={book.author}
        link={book.link}
      />
    );
}

function Dash() {
    return (
      <div>
        <h1 className="heading">Jinchi Books</h1>
        {books.map(createCard)}
      </div>
    );
}

export default Dash;
